import { Link } from "react-router-dom";
import "../css/Home.css";

function Home() {
	const setMainImage = () => {
		const mainImage = document.createElement("img");
		mainImage.src = `../../asset/img/cloudy.jpeg`;
		document.body.appendChild(mainImage);
	};

	return (
		<div id="main">
			{setMainImage}
			<h1>Home</h1>
			<nav>
				<Link to="todo">Todo</Link>
			</nav>
		</div>
	);
}

export default Home;
